//
//	Extending built-in Array object
//	- array.removeDuplicates()
//	- array.empty()
//
Array.prototype.removeDuplicates = function () {
for(i = 0; i < this.length; i++){
    for(j = this.length-1; j>i; j--){        
        if(this[i][0] == this[j][0]){
            this.splice(j,1);
        }
    }
}
}

// -----------------------------------------------------------------------------------

Array.prototype.empty = function () {
for(i = 0; i <= this.length; i++){
    this.shift();
}
}

